import classes from "./NameMsgBox.module.css";


const NameMsgBox =()=>{


return (

<div className={classes.nameMsgBox}>


  <div className={classes.usersName}> <b> Bibhuprasad Mahakud </b></div>



  <div className={classes.lastMessage} > Hi Are you there? </div>

</div>
);

}

